import React from "react";
import { Header } from "./homepage";
import { useNavigate } from "react-router";


function Main(props){
    let lgt=useNavigate();


function Logout(){ 

    localStorage.removeItem('auth');
    localStorage.removeItem('token');
    lgt('/');

 }
 function closetoggle(){
    document.getElementById('mainsidebar').style.display = 'none'
  }
 
  function toggle(){
    if(document.getElementById('mainsidebar'). style.display ==='block' ){
      document.getElementById('mainsidebar').style.display = 'none'
    }else{
      document.getElementById('mainsidebar').style.display = 'block'
    }

  }
 
    return(
        <div>

         <div style={{marginBottom:'60px'}}>
         <Header login='Logout' sidebarclass='w3-sidebar w3-bar-block w3-black w3-card w3-animate-left  ' close={closetoggle} toggl={toggle} sidebar='mainsidebar' home='Home' loginfont='fa fa-usd' navi={Logout}  />
         </div>
<h1 >Hello world</h1>
        </div>
    );
}

export default Main;
